import axios from 'axios'

const fetchQuestions = () => {
  const fetchQ = async () => {
    const { data } = await axios.get('/api/expression')

    localStorage.setItem('qInfo', JSON.stringify(data))
  }
  fetchQ()
}

export default fetchQuestions
